import axios from 'axios';


export const BASE_URL = 'https://newscatcher.p.rapidapi.com/v1/search_enterprise';
const options = {
    method: 'GET',
    params: {
        q: 'Elon Musk',
        lang: 'en',
        sort_by: 'relevancy',
        page: '1',
        media: 'True'
    },
    headers: {
        'X-RapidAPI-Key': 'bfd3f8e584mshcafcda57559f1aep1f4777jsna049934a8f67',
        'X-RapidAPI-Host': 'newscatcher.p.rapidapi.com'
    }
};
export const fetchFromAPI = async (url) => {
    const { data } = await axios.get(`${BASE_URL}/${url}`, options);
    console.log(data)
    return data;
};
